var m = regexp.MustCompile(`new Image\(\).src = '(.+?)';`)

func ddosGuard(u *url.URL, client *http.Client) error {
	req2, err := http.NewRequest("GET", jsCheckURL, nil)
	if err != nil {
		return err
	}
	resp2, err := client.Do(req2)
	if err != nil {
		return err
	}
	defer func() { _ = resp2.Body.Close() }()
	body, err := io.ReadAll(resp2.Body)
	if err != nil {
		return err
	}
	text := string(body)

	res := m.FindStringSubmatch(text)

	if len(res) < 2 {
		return errors.New("no dgg URL")
	}

	ddgURL := url.URL{Host: u.Host, Path: res[1], Scheme: u.Scheme}

	//log.Printf("Result URL: %v", ddgURL)

	req2, err = http.NewRequest("GET", ddgURL.String(), nil)
	if err != nil {
		return err
	}

	resp2, err = client.Do(req2)
	if err != nil {
		return err
	}
	defer func() { _ = resp2.Body.Close() }()

	ddgURL.Path = markURL

	req, err := http.NewRequest("POST", ddgURL.String(), bytes.NewBuffer(markBytes))
	if err != nil {
		return err
	}
	req.Header.Set("authority", "www1.fips.ru")
	req.Header.Set("accept", "*/*")
	req.Header.Set("accept-language", "ru-RU,ru;q=0.9,en-US;q=0.8,en;q=0.7,fr;q=0.6,mg;q=0.5,es;q=0.4")
	req.Header.Set("content-type", "text/plain;charset=UTF-8")
	req.Header.Set("dnt", "1")
	req.Header.Set("origin", "https://www1.fips.ru")
	req.Header.Set("sec-ch-ua", `".Not/A)Brand";v="99", "Google Chrome";v="103", "Chromium";v="103"`)
	req.Header.Set("sec-ch-ua-mobile", "?0")
	req.Header.Set("sec-ch-ua-platform", `"Windows"`)
	req.Header.Set("sec-fetch-dest", "empty")
	req.Header.Set("sec-fetch-mode", "cors")
	req.Header.Set("sec-fetch-site", "same-origin")
	req.Header.Set("user-agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/103.0.0.0 Safari/537.36")

	resp, err := client.Do(req)
	if err != nil {
		return err
	}
	//fmt.Println("response Headers:", resp.Header)
	defer func() { _ = resp.Body.Close() }()

	return nil
}
